// 详情页
export const CardWrapper = styled.div`
  display: flex;
  justify-content: center;
  // background: #fbfbfb;
`

export const LeftCard = styled.div`
  width: 500px;
  margin-right: 30px;
  background: pink;
`

export const RightCard = styled.div`
  width: 320px;
  height: 700px;
  background: skyblue;
`
